import React from 'react';
import { NavLink } from 'react-router-dom';
import classes from './Navbar.module.css';
import '../Navbar'






const Navbar = () => {
    // const handleClick = e => {
    //   e.preventDefault();
    //   document.getElementsByClassName('navTrigger')[0].classList.toggle('active');
    //   document.getElementById('mainListDiv').classList.toggle('show_list');
    //   $('#mainListDiv').fadeIn();
    // }


    
    return (
        <header>
        <nav className= { classes.navlinks }>
            <div className="container">
                <div className="logo" id="title">
                    <NavLink to="/" id="header">Cincinnati Tourism- Spring 2021</NavLink>
                </div>
                <div id="mainListDiv" className="main_list">
                    <ul className= { classes.navlinks }>
                    <li><NavLink style={{textDecoration: 'none'}} to="/Home">Home</NavLink></li>
                    <li><NavLink to="/Covid 19">Covid 19</NavLink></li>
                    <li><NavLink to="/About">About</NavLink></li>
                    <li><NavLink to="/Our Story">Our Story</NavLink></li>
                    <li><NavLink to="/contact">Contact</NavLink></li>
                    </ul>
                </div>
             </div>
           </nav>
        </header>
    )
};

<Navbar fixed="top" />


export default Navbar
